@Override
public DocValues docValues(String field) throws IOException {
  DocValues inner = super.docValues(field);
  if (inner == null) {
    return inner;
  }

  CategoryListParams clp = dvFieldMap.get(field);
  if (clp == null) {
    return inner;
  } else {
    return new OrdinalMappingDocValues(inner, clp);
  }
}

